import './App.css';
import TeamBuilder from "./Component/TeamBuilder";
import FilterBar from "./Component/FilterBar";
import PokemonList from "./Component/PokemonList";
import {CgPokemon} from "react-icons/cg"
import {useEffect, useState} from "react";
import {starterData} from "./data/starterData";
import axios from "axios";

function App() {

    const [pokemonData, setPokemonData] = useState(starterData);

    const fetchPokemon = (start, count) => {
        axios.get("http://localhost:8080/pokemon?start=" + start + "&count=" +count)
            .then(pokemonDTOList => setPokemonData(pokemonDTOList.data));
    }

    return (
        <div className="App">
            <header>
                <div className={"title"}>
                    <CgPokemon/>
                    Pok√©Builder
                </div>
            </header>
            <div className={"content"}>
                <TeamBuilder/>
                <div className={"pokePickModal"}>
                    <FilterBar pokemonData={pokemonData} setPokemonData={setPokemonData}/>
                    <PokemonList pokemonData={pokemonData}/>
                </div>
            </div>
        </div>
    );
}

export default App;
